"use strict";(self.webpackChunkdigital_garden=self.webpackChunkdigital_garden||[]).push([[78473],{74434:e=>{e.exports=JSON.parse('{"label":"article","permalink":"/docs/tags/article","allTagsPath":"/docs/tags","count":79,"items":[{"id":"Entertainment/TV-Shows/The Wire","title":"\ud83d\ude80  The show in 3 Sentences","description":"This show is not a typical cop show. The Wire is a show that looks at the war on drugs and the horrific consequences of it.  It is a show about people and institutions and how they relate to each other.","permalink":"/docs/Entertainment/TV-Shows/The Wire"},{"id":"Books/Book Reviews/Models","title":"\ud83d\ude80 The Book in 3 Sentences","description":"This book is about dating for men. But it is an honest book, that says that you should start with yourself and become a person people likes and you are comfortable with. Real men are vulnerable and in charge of their feelings.","permalink":"/docs/Books/Book Reviews/Models"},{"id":"Working/Agile","title":"Aglie","description":"Planning Poker","permalink":"/docs/Working/Agile"},{"id":"AI/AI","title":"AI","description":"- The conspiracy to make AI harder than it is!","permalink":"/docs/AI/"},{"id":"AI/AI Strategy","title":"AI Strategy","description":"AI strategy is about having a clear view of how to enable the organization to utilize AI capabilities. An AI strategy should encompass the following subsets of strategies.","permalink":"/docs/AI/AI Strategy"},{"id":"Mac/Alfred","title":"Alfred","description":"Alfred is basically Spotlight on steroids. It contains all the features of Spotlight but is more powerful. If you purchase the powerpack, you also get access to workflows.","permalink":"/docs/Mac/Alfred"},{"id":"Iphone/Apps","title":"Apps","description":"Streaks","permalink":"/docs/Iphone/Apps"},{"id":"Articles/Articles","title":"Articles","description":"List of interesting articles. I\'m looking forward to seeing some of the articles I read and checking if they stood the test of time.","permalink":"/docs/Articles/"},{"id":"Cloud/Azure","title":"Azure","description":"Storage","permalink":"/docs/Cloud/Azure"},{"id":"Body/Body","title":"Body","description":"- Degree of Freedom Problem","permalink":"/docs/Body/"},{"id":"Career/Career","title":"Career","description":"Here I write about career and about how to better oneself in one\'s career.","permalink":"/docs/Career/"},{"id":"Mathematics/Chaos","title":"Chaos","description":"I discovered chaos partly through two main venues. The first is the teachings and works of Nassim Niclas Taleb, which are mainly concerned with uncertainty and rare events that pose risks.","permalink":"/docs/Mathematics/Chaos"},{"id":"Cloud/Cloud","title":"Cloud","description":"Virtual Networks","permalink":"/docs/Cloud/"},{"id":"AI/Data Science/Computer Vision","title":"Computer Vision","description":"Vision Transformer","permalink":"/docs/AI/Data Science/Computer Vision"},{"id":"Curiosity/Curiosity","title":"Curiosity","description":"- Information Noise Based upon N.N. Taleb, where more information will act as noise and disturb the signals.","permalink":"/docs/Curiosity/"},{"id":"CyberSecurity/CyberSecurity","title":"CyberSecurity","description":"Penetration testing is essentially simulating attacks and investigating the consequences of said attacks. The end goal is not to get hacked.","permalink":"/docs/CyberSecurity/"},{"id":"Programming/Flutter","title":"Dart","description":"To my knowledge, Dart is a beautiful language that is completely null-safe.","permalink":"/docs/Programming/Flutter"},{"id":"AI/Data Drift","title":"Data Drift","description":"Data drift refers to the phenomenon where the statistical properties of a dataset used for machine learning or analysis change over time. This alteration can be due to various factors such as shifts in data collection processes, changes in the underlying distribution of the data, or modifications in the environment from which the data originates. Detecting and addressing data drift is crucial to maintaining the performance and reliability of machine learning models and analytical systems.","permalink":"/docs/AI/Data Drift"},{"id":"AI/Data Science/Data Science","title":"Data Science","description":"What is data science? It is a bunch of different jobs bunched together and given the tie of AI to make a company sound innovative.","permalink":"/docs/AI/Data Science/"},{"id":"AI/Data Science/Data Science Project Start-Up Phase","title":"Data Science Project Start-Up Phase","description":"The start-up phase of a data science project is for me one of the most exciting parts of the project, but it is also one of the most unclear phases. To have a fighting chance of making it to production, there are several factors that are extremely important and need to be addressed.","permalink":"/docs/AI/Data Science/Data Science Project Start-Up Phase"},{"id":"Database/Database","title":"Database","description":"In the context of business, everything is a database. Databases are the bedrock of how we design things nowadays.","permalink":"/docs/Database/"},{"id":"Decision","title":"Decision","description":"In order to make better decisions, I try to structure and stabilize the process for making big decisions.  I define a big decision as a decision that will affect you every day of your life for no shorter than 3 months or for a large duration of time every year (Every weekend for the rest of the year for example). This means that things such as accepting a job offer and moving in with your spouse in a new place are categorized as big decisions.","permalink":"/docs/Decision"},{"id":"Travel/Places/Laos","title":"Description","description":"Vientiane","permalink":"/docs/Travel/Places/Laos"},{"id":"Travel/Places/Sapporo and Niseko","title":"Description","description":"Sapporo is a city in Hokkaido Japan. It is very far north, and it is cold there. It is also an excellent place to go skiing.  Sapporo is quite a big City, Niseko is more of a village with skiing slopes and some large resorts nearby.","permalink":"/docs/Travel/Places/Sapporo and Niseko"},{"id":"Travel/Places/Singapore","title":"Description","description":"Best Experiences","permalink":"/docs/Travel/Places/Singapore"},{"id":"Design/Design","title":"Design","description":"Atomic Design","permalink":"/docs/Design/"},{"id":"DevOps/DevOps","title":"DevOps","description":"-","permalink":"/docs/DevOps/"},{"id":"Music/Discover and Sharing","title":"Discover and Sharing","description":"I try to expand my musical horizon as much as possible. So that I can have music for all my moods and situations. Most of all, the music I discover is either through Spotify or YouTube, but sometimes I think that the best experiences are going to a festival or concert and getting introduced to new artists.","permalink":"/docs/Music/Discover and Sharing"},{"id":"Food/Drink","title":"Drink","description":"-","permalink":"/docs/Food/Drink"},{"id":"Economics/Economics","title":"Economics","description":"It is often called the dismal science. More than any other science, it is one of the most challenging sciences, as it is almost impossible to conduct experiments.","permalink":"/docs/Economics/"},{"id":"Exercise/Exercise","title":"Exercise","description":"I try to exercise between 3 and 5 times a week. I try to separate between goals and expectations so that I can always reach for something hard to do.","permalink":"/docs/Exercise/"},{"id":"Programming/Python/FastAPI","title":"FastAPI","description":"I like Fastapi as a backend service. It is very easy to learn and it is good when designing apis.","permalink":"/docs/Programming/Python/FastAPI"},{"id":"AI/Data Science/Feature Engineering","title":"Feature Engineering","description":"Dummy vs One-hot","permalink":"/docs/AI/Data Science/Feature Engineering"},{"id":"Exercise/Flexibility/Flexibility","title":"Flexibility","description":"I started working on flexibility far to late, but it is an awsome way of doing quick workouts either at home.","permalink":"/docs/Exercise/Flexibility/"},{"id":"Cloud/GCP","title":"GCP","description":"Firebase and Flutter is a very cool combo. It has great material on how to work with and helpful docs. It makes creating a simply crud app in flutter super easy.","permalink":"/docs/Cloud/GCP"},{"id":"DevOps/Git","title":"Git","description":"Git was developed by Linus Torvalds, who also developed the operating system Linux.  He jokingly said he named both tools after himself. Git was made because making changes and collaborating on Linux had become too challenging and a new way of doing version control was needed.","permalink":"/docs/DevOps/Git"},{"id":"DevOps/GitHub Actions","title":"GitHub Actions","description":"GitHub Actions are written in YAML file format. There are multiple ways of triggering GitHub actions, related to git-actions such as push/pull requests. But also cron schedules. It is a cheap and flexible way of doing simple jobs. One good advantage is that all the functions are in the same repo. One source of truth.","permalink":"/docs/DevOps/GitHub Actions"},{"id":"Economics/Investing","title":"Investing","description":"I find the thoughts of Vitaly Katelson on value investing quite interesting, as well as having a good and stable look at the value you invest in your life.","permalink":"/docs/Economics/Investing"},{"id":"Iphone/Iphone","title":"Iphone","description":"-","permalink":"/docs/Iphone/"},{"id":"Programming/Javascript","title":"Javascript","description":"Javascript is the most popular language in the world, so you should at least have some knowledge of how it works and how it functions.","permalink":"/docs/Programming/Javascript"},{"id":"Mac/Karabiner","title":"Karabiner","description":"Karabiner is a powerful and customizable keyboard remapping tool designed specifically for macOS. It allows users to modify the behavior of their keyboards by remapping keys, creating shortcuts, and implementing various keyboard modifications. With Karabiner, users can redefine keys to perform different functions or assign complex combinations of keys to trigger specific actions. This enables users to personalize their keyboard layout and streamline their workflow, making it easier and more efficient to navigate through applications and perform tasks.","permalink":"/docs/Mac/Karabiner"},{"id":"Food/Kitchen","title":"Kitchen","description":"Cutting techniques","permalink":"/docs/Food/Kitchen"},{"id":"Language/Language","title":"Language","description":"Latin Expressions","permalink":"/docs/Language/"},{"id":"Learning/Learning","title":"Learning","description":"I think learning is a difficult topic as it is extremely individual and is also one of the most important skills to have. Moreover, learning is a process as well, and in order to become a skilled learner you need to not only try different methods but also be able to evaluate yourself in a good and non-discriminate way.","permalink":"/docs/Learning/"},{"id":"Books/Literature/Literature","title":"Literature","description":"This section is about the fine arts of literature and how I relate to them. I will use this section mostly as a way for me to relate to the great works.","permalink":"/docs/Books/Literature/"},{"id":"Living","title":"Living","description":"What is living?","permalink":"/docs/Living"},{"id":"Mac/Mac","title":"Mac","description":"I switched from Windows to Mac in 2021 and used it privately until 2022 when I switched to a Mac for work as well.","permalink":"/docs/Mac/"},{"id":"Working/Management","title":"Management","description":"- Some work on the management from an engineering perspective","permalink":"/docs/Working/Management"},{"id":"Mathematics/Mathematics","title":"Mathematics","description":"Winning starts with knowing what game you\'re playing. Game theory is a fascinating concept, and one of the most important \\"case studies\\" is the prisoner\'s dilemma. Understanding mathematical optimal strategies is essential when understanding how the world works.","permalink":"/docs/Mathematics/"},{"id":"Motivation/Motivation","title":"Motivation","description":"Motivation for me is being able to intrinsically make the right decision. This implies that motivation is not driven by external factors in this definition. By removing external factors, motivation simply becomes a function of want and mental energy.","permalink":"/docs/Motivation/"},{"id":"AI/Language/NLP or LLM","title":"NLP","description":"Natural Language Processing (NLP) is using machine learning techniques to work with text.","permalink":"/docs/AI/Language/NLP or LLM"},{"id":"Obsidian/Obsidian","title":"Obsidian","description":"Obsidian is where I store my knowledge. I use it as a tool for writing, for storing information and knowledge, and for remembering. The main point of using obsidian is that it is living on your personal computer, can be treated as a good tool for writing quickly and also can be integrated with a lot of different tools, which probably is a huge advantage.","permalink":"/docs/Obsidian/"},{"id":"Philosophy/On The Duality of Rights and Responsibilities","title":"On The Duality of Rights and Responsibilities","description":"Rights are made by and for humans, and can by definition therefore also be taken away from them. We create rights by fighting, bleeding and dying for them to be made and upheld. This is true for all major events where mankind has lept from darkness and abuse to a tiny bit lighter society.  By having rights, you in turn have to accept the responsibility of upholding those rights for yourself and also others.","permalink":"/docs/Philosophy/On The Duality of Rights and Responsibilities"},{"id":"Tools/ChatGPT","title":"OpenAI","description":"GPT-4 is one of the best tools I have used in the last couple of years. It is astonishing technology that makes me more productive.","permalink":"/docs/Tools/ChatGPT"},{"id":"Food/Recipes/Pasta","title":"Pasta","description":"- Venetian Crab and Prosecco Linguine Pasta and Frutti di Mare :P, a delightful summer dish that is fresh and","permalink":"/docs/Food/Recipes/Pasta"},{"id":"Personal","title":"Personal","description":"My Knowledge Wiki contains most of my knowledge (From 2023 onwards mostly). I try to gather all information I find interesting and my learnings in this wiki. The goal is to create a digital garden for my thoughts and share as much as possible of the things I find interesting. The goal is to have a comprehensive library for my thoughts and experiences that I can share with the world and look back on.","permalink":"/docs/Personal"},{"id":"Food/Recipes/Recipes","title":"Philosophy","description":"I think following recipes automatically is a sign of an unimaginative mind, and as such one should try to experiment and expand the palette. I have structured my favorite and interesting recipes as a dynamic document with my thoughts and musing on the recipes. I want to be able to continuously update my recipes with more interesting","permalink":"/docs/Food/Recipes/"},{"id":"Philosophy/Philosophy","title":"Philosophy","description":"System Building","permalink":"/docs/Philosophy/"},{"id":"Books/Literature/Poems","title":"Poems","description":"I think good poems are powerful in a way books cannot be. It is the young man\'s game, and its simplicity is in itself artful.","permalink":"/docs/Books/Literature/Poems"},{"id":"Politics/Politics","title":"Politics","description":"Important figures","permalink":"/docs/Politics/"},{"id":"Database/Postgres","title":"Postgres","description":"Open-source database.","permalink":"/docs/Database/Postgres"},{"id":"Productivity/Productivity Theory","title":"Productivity Theory","description":"Gilb\xb4s Law","permalink":"/docs/Productivity/Productivity Theory"},{"id":"Programming/Programming","title":"Programming","description":"I think an underrated aspect of programming is understanding computers, for engineers and self-taught programmers, it might be difficult to understand the intricacies of computers.","permalink":"/docs/Programming/"},{"id":"Programming/Python/Pytest","title":"Pytest","description":"Pytests is a wrapper around the unit test python test framework. It makes it a bit easier to write tests.","permalink":"/docs/Programming/Python/Pytest"},{"id":"Programming/Python/Python","title":"Python","description":"Scripting","permalink":"/docs/Programming/Python/"},{"id":"Food/Recipes/Recipes to try","title":"Recipes to try","description":"- Carne Asada Looks like a good way to expand the Mexican cuisine.","permalink":"/docs/Food/Recipes/Recipes to try"},{"id":"AI/Data Science/Recommendation Systems","title":"Recommendation Systems","description":"There are two types of recommendation systems","permalink":"/docs/AI/Data Science/Recommendation Systems"},{"id":"Philosophy/Religion","title":"Religion","description":"Religion: A Resilient Concept","permalink":"/docs/Philosophy/Religion"},{"id":"Working/Remote Work","title":"Remote Work","description":"I did some remote working when I was at Bali, working primarily on my side projects. I felt like it is very difficult to motivate oneself if one does not have a social society or connection. It was fun however to experience new places.","permalink":"/docs/Working/Remote Work"},{"id":"Programming/Rust","title":"Rust","description":"- shill rust","permalink":"/docs/Programming/Rust"},{"id":"Database/Snowflake","title":"Snowflake","description":"Snowflake is a company providing a data warehouse.","permalink":"/docs/Database/Snowflake"},{"id":"Programming/SQL","title":"SQL","description":"PostgreSQL","permalink":"/docs/Programming/SQL"},{"id":"Exercise/Strength/Strength","title":"Strength Training","description":"I started strength training when I was 17, and did some on and off until I was 19. From 19 to 24, I consistently worked out between 3 and 5 days a week.  I did a lot of failing and needed a lot of guidance during that period. First of all, I started with only upper body exercises and neglected to work out my legs for quite a while. I think this was because I was not flexible enough to do the squat exercises correctly. In hindsight, it is difficult to assess in hindsight what the causation for the lack of leg exercises, but I am certain the lack of flexibility made doing leg workouts quite a bit difficult.","permalink":"/docs/Exercise/Strength/"},{"id":"Learning/Talks","title":"Talks","description":"List of talks that I have found intersting","permalink":"/docs/Learning/Talks"},{"id":"Thinking/Thinking","title":"Thinking","description":"- Normalization of Deviance","permalink":"/docs/Thinking/"},{"id":"Tools/Tools","title":"Tools","description":"Tools are the things I use to accomplish tasks. A tool can both be a requirement and a supplement to myself.","permalink":"/docs/Tools/"},{"id":"Entertainment/TV-Shows/TV-Shows","title":"TV-Shows","description":"TV shows have been my favorite way of seeing things. They are good to work on","permalink":"/docs/Entertainment/TV-Shows/"},{"id":"Working/Working","title":"Working","description":"I have currently worked in different types of work. From being a driver to being a moving-operator, to warehouse Employee,  and finally Data Scientist.","permalink":"/docs/Working/"},{"id":"Writing/Writing","title":"Writing","description":"Writing is hard.  It takes time, effort and experience. It is something that takes effort to even start.","permalink":"/docs/Writing/"}],"unlisted":false}')}}]);